style.css:
body {
    background-color: #D6EAF8; /* Soft Blue Background */
    color: #2C3E50;           /* Dark Blue Text */
    font-family: Arial, sans-serif;
    line-height: 1.6;
}

header, footer {
    background-color: #34495E; /* Darker Blue for header and footer */
    color: #ECF0F1;
    padding: 1em;
}

a {
    color: #2980B9;            /* Link Color */
    text-decoration: none;
}

a:hover {
    text-decoration: underline;
}
